import React from "react";
import { Grid, Typography } from "@material-ui/core";

export default function Wanna() {
  return (
    <Grid
      container
      direction="column"
      justifyContent="center"
      alignItems="center"
    >
      <Grid item>
        <Typography variant="body1" component="h2">
          Wanna come in contact?
        </Typography>
      </Grid>
    </Grid>
  );
}
